B.Qz=new A.cZ("Euphorie","\ud83c\udf1f","Ehret : L'homme sain ne se fatigue pas \u2014 il est mouvement perp\xe9tuel.","Tu exp\xe9rimentes un aper\xe7u de la vitalit\xe9 sans obstruction.","Bouge ! Marche, danse, respire profond\xe9ment. C'est la vie qui s'exprime.")
B.QA=new A.cZ("Euphorie","\ud83c\udf1f","Morse : L'euphorie est la vitalit\xe9 naturelle qui \xe9merge quand les obstructions se dissolvent.","Ton syst\xe8me endocrinien produit des endorphines. Le corps c\xe9l\xe8bre son nettoyage.","Savoure ce moment ! C'est la preuve que le je\xfbne fonctionne.")
B.QB=new A.cZ("Clart\xe9","\ud83e\udde0","Sebi : Quand le mucus part du cerveau, la pens\xe9e devient cristalline.","Le mucus encombre le cerveau autant que le corps. Le je\xfbne le lib\xe8re.","M\xe9dite et profite de cette clart\xe9. Elle est un aper\xe7u de ta sant\xe9 naturelle.")
B.QC=new A.cZ("Naus\xe9e","\ud83e\udd22","Sebi : La naus\xe9e est le signe que le corps expulse le mucus accumul\xe9.","Le foie et la v\xe9sicule biliaire se purgent. C'est un nettoyage en profondeur.","Petites gorg\xe9es d'eau ti\xe8de. Repose-toi. Si trop intense, brise avec de la papaye.")
B.QD=new A.cZ("Mal de t\xeate","\ud83e\udd15","Morse : Les maux de t\xeate sont des toxines qui se lib\xe8rent du cerveau et de la lymphe.","Le syst\xe8me lymphatique draine les d\xe9chets accumul\xe9s. La t\xeate est souvent le premier signe.","Bois de l'eau de source. Applique une compresse froide sur le front. Repose-toi.")
B.QE=new A.cZ("Anxieux","\ud83d\ude30","Sebi : L'anxi\xe9t\xe9 vient souvent d'un syst\xe8me nerveux encombr\xe9 de mucus.","Le nettoyage peut temporairement amplifier l'anxi\xe9t\xe9 avant de la r\xe9soudre.","Respire. Marche pieds nus dans l'herbe. Le contact avec la terre aide.")
B.QF=new A.cZ("Faim","\ud83d\ude0b","Morse : La faim est un signal du mental, pas du corps.","Les premi\xe8res heures de faim sont psychologiques. Le corps a des r\xe9serves suffisantes.","Bois de l'eau ti\xe8de avec un peu de citron. La faim passera en 20-30 min.")
B.QG=new A.cZ("Calme","\ud83e\uddd8","Morse : Le calme profond est le signe que le syst\xe8me nerveux se r\xe9\xe9quilibre.","Sans digestion, le syst\xe8me parasympathique domine. Paix int\xe9rieure naturelle.","M\xe9dite ou fais des exercices de respiration pour amplifier cet \xe9tat.")
B.QH=new A.cZ("Calme","\ud83e\uddd8","Ehret : La Nature gu\xe9rit, pas le m\xe9decin. Tu es sur le bon chemin.","Le calme profond est le signe que le corps se gu\xe9rit naturellement.","Reste dans cet \xe9tat. M\xe9ditation et nature amplifient les bienfaits.")
B.QI=new A.cZ("Clart\xe9","\ud83e\udde0","Ehret : Le je\xfbne avanc\xe9 apporte une clart\xe9 mentale extraordinaire.","Le cerveau fonctionne mieux aux corps c\xe9toniques qu'au glucose. Tu le ressens.","Profite-en pour r\xe9fl\xe9chir, \xe9crire, ou m\xe9diter.")
B.QJ=new A.cZ("Anxieux","\ud83d\ude30","Morse : L'anxi\xe9t\xe9 peut \xeatre li\xe9e aux surr\xe9nales fatigu\xe9es qui se r\xe9veillent.","Le je\xfbne stimule les surr\xe9nales. Si elles sont affaiblies, l'anxi\xe9t\xe9 peut appara\xeetre.","Respire profond\xe9ment. Marche dans la nature. L'anxi\xe9t\xe9 passera \xe0 mesure que les surr\xe9nales se renforcent.")
B.QK=new A.cZ("Calme","\ud83e\uddd8","Sebi : L'eau est le premier m\xe9dicament. Quand le corps est propre, l'esprit l'est aussi.","Le syst\xe8me nerveux fonctionne mieux sans mucus. La paix int\xe9rieure est naturelle.","Profite de ce calme pour r\xe9fl\xe9chir \xe0 tes objectifs de sant\xe9.")
B.QL=new A.cZ("Froid","\ud83e\udd76","Ehret : Le froid est un signe que le m\xe9tabolisme se recentre sur le nettoyage interne.","L'\xe9nergie est redirig\xe9e. Le corps privil\xe9gie la gu\xe9rison au confort thermique.","Habille-toi chaudement. Un bain chaud peut aider.")
B.QM=new A.cZ("Mal de t\xeate","\ud83e\udd15","Ehret : Le mal de t\xeate est le mucus qui se lib\xe8re du cerveau.","Les d\xe9p\xf4ts de mucus accumul\xe9s pendant des ann\xe9es se dissolvent. C'est inconfortable mais n\xe9cessaire.","Eau ti\xe8de. Repos. Un lavement peut acc\xe9l\xe9rer l'\xe9limination et soulager.")
B.QN=new A.cZ("Vertige","\ud83d\ude35","Sebi : Le vertige peut signifier un nettoyage rapide ou une carence en min\xe9raux.","Le corps lib\xe8re beaucoup de toxines d'un coup. Les \xe9lectrolytes changent.","Assieds-toi. Bois de l'eau de source lentement. Si \xe7a persiste, brise le je\xfbne.")
B.QO=new A.cZ("Faim","\ud83d\ude0b","Ehret : La vraie faim est rare. Ce que tu ressens est l'habitude.","Le corps est programm\xe9 par les horaires de repas. \xc7a s'estompe.","Distrait-toi avec une promenade ou de la lecture. La faim passera.")
B.QP=new A.cZ("Bien","\ud83d\ude0a","Morse : Ton corps est en harmonie avec le processus de nettoyage.","La filtration lymphatique progresse sans r\xe9sistance. Excellent signe.","Continue ainsi ! Maintiens ton hydratation.")
B.QQ=new A.cZ("Clart\xe9","\ud83e\udde0","Morse : La clart\xe9 mentale est le signe que le cerveau se nettoie de la congestion lymphatique.","Les corps c\xe9toniques nourrissent le cerveau efficacement. Tu en r\xe9coltes les b\xe9n\xe9fices.","Profite de cette clart\xe9 ! M\xe9dite, journal, ou simplement observe cette lucidit\xe9.")
B.QR=new A.cZ("Naus\xe9e","\ud83e\udd22","Morse : La naus\xe9e indique que le foie lib\xe8re de la bile charg\xe9e de toxines.","C'est un excellent signe de d\xe9toxification. Le corps \xe9vacue ce qui l'encombrait.","Petites gorg\xe9es d'eau ti\xe8de avec citron. Respire profond\xe9ment. Si \xe7a persiste, envisage de briser.")
B.QS=new A.cZ("Fatigue","\ud83d\ude34","Morse : La fatigue pendant le je\xfbne est un signe que les surr\xe9nales travaillent.","Ton corps redirige son \xe9nergie vers le nettoyage. C'est temporaire.","Repose-toi. \xc9vite l'exercice intense. Un rebounder l\xe9ger peut aider la lymphe.")
B.QT=new A.cZ("Froid","\ud83e\udd76","Morse : Le froid est d\xfb \xe0 la vasoconstriction \u2014 le sang va vers les organes internes pour nettoyer.","Le m\xe9tabolisme ralentit pour \xe9conomiser de l'\xe9nergie et la concentrer sur la gu\xe9rison.","Couvre-toi bien. Marche l\xe9g\xe8rement pour stimuler la circulation.")
B.QU=new A.cZ("Bien","\ud83d\ude0a","Ehret : Le bien-\xeatre signifie que l'obstruction diminue \u2014 V = P \u2212 O.","Moins l'obstruction est grande, plus la vitalit\xe9 est \xe9lev\xe9e.","Continue ! Ton corps se lib\xe8re du mucus progressivement.")
B.QV=new A.cZ("Anxieux","\ud83d\ude30","Ehret : L'anxi\xe9t\xe9 peut venir du mucus dissous qui irrite le syst\xe8me nerveux.","Les toxines en circulation peuvent temporairement perturber le syst\xe8me nerveux.","Respiration profonde. Si l'anxi\xe9t\xe9 est forte, un lavement ou briser doucement.")
B.QW=new A.cZ("Euphorie","\ud83c\udf1f","Sebi : C'est la vie qui s'exprime quand tu cesses de l'encombrer.","Le corps lib\xe9r\xe9 de mucus vibre \xe0 sa fr\xe9quence naturelle. Pure vitalit\xe9.","Savoure ! C'est la preuve que le protocole fonctionne.")
B.QX=new A.cZ("Mal de t\xeate","\ud83e\udd15","Sebi : Le mal de t\xeate vient des d\xe9p\xf4ts de calcium inorganique qui se dissolvent.","Le calcium inorganique accumul\xe9 se lib\xe8re dans le sang pour \xeatre \xe9vacu\xe9.","Eau de source abondante. Repos. Le fer bio-disponible aide \u2014 bois du th\xe9 de burdock.")
B.QY=new A.cZ("Vertige","\ud83d\ude35","Ehret : Le vertige indique une \xe9limination trop rapide. Ralentis le processus.","Le corps lib\xe8re plus de toxines qu'il ne peut en \xe9vacuer.","Assieds-toi. Bois de l'eau. Envisage de briser doucement avec un fruit.")
B.QZ=new A.cZ("Fatigue","\ud83d\ude34","Ehret : La fatigue est le mucus qui se dissout dans le sang avant d'\xeatre \xe9limin\xe9.","C'est une crise de nettoyage. Le corps utilise son \xe9nergie pour \xe9vacuer les d\xe9chets.","Repose-toi. Le je\xfbne rationnel demande de la patience.")
B.R_=new A.cZ("Fatigue","\ud83d\ude34","Sebi : La fatigue est le mucus qui se d\xe9tache. C'est bon signe.","L'\xe9nergie est redirig\xe9e vers l'\xe9limination de la compromission de la muqueuse.","Repose-toi. Le corps fait un travail profond.")
B.R0=new A.cZ("Naus\xe9e","\ud83e\udd22","Ehret : La naus\xe9e signifie que le mucus dissous entre dans le sang pour \xeatre \xe9vacu\xe9.","Le sang se charge temporairement de d\xe9chets. Le foie et les reins travaillent pour les filtrer.","Petites gorg\xe9es d'eau avec citron. Brise avec un demi-orange si c'est trop intense.")
B.R1=new A.cZ("Vertige","\ud83d\ude35","Morse : Le vertige peut indiquer une d\xe9shydratation ou une chute de pression.","Les \xe9lectrolytes changent pendant le je\xfbne. Le corps s'adapte.","Assieds-toi imm\xe9diatement. Bois de l'eau lentement. Si \xe7a persiste, brise le je\xfbne.")
B.R2=new A.cZ("Bien","\ud83d\ude0a","Sebi : Le corps est fait de min\xe9raux. Quand le mucus part, les min\xe9raux travaillent.","Les 102 min\xe9raux essentiels se r\xe9\xe9quilibrent naturellement pendant le je\xfbne.","Excellent ! Continue et maintiens ton hydratation avec de l'eau de source.")
B.R3=new A.cZ("Faim","\ud83d\ude0b","Sebi : La faim dispara\xeet quand tu arr\xeates de mettre des ordures dedans.","Le corps cherche par habitude. Les r\xe9serves sont suffisantes pour des jours.","Eau de source. Si vraiment difficile, un th\xe9 d'ortie ou de pissenlit.")
B.R4=new A.cZ("Froid","\ud83e\udd76","Sebi : Le fer est l'\xe9tincelle de la vie. Le froid peut indiquer un manque de fer bio.","Le fer bio-disponible est essentiel pour la circulation et la chaleur corporelle.","Couvre-toi. Apr\xe8s le je\xfbne, consomme des aliments riches en fer bio (sarsaparilla, burdock).")
