B.xf=new A.kg(4,"trophology")
B.aET=new A.bT("\u2697\ufe0f","Combinaison fruit + l\xe9gume","Ehret et Morse d\xe9conseillent de m\xe9langer fruits et l\xe9gumes au m\xeame repas. Les fruits fermentent au-dessus des l\xe9gumes en digestion.","Arnold Ehret",B.xf,9)
B.aEV=new A.bT("\ud83c\udf47","Activation matinale","Le matin, les fruits astringents (raisins, baies, agrumes) activent la filtration r\xe9nale apr\xe8s le repos nocturne. Commencez par un mono-fruit.","Dr. Morse",B.ej,9)
B.aEW=new A.bT("\ud83e\udd57","Repas de midi","Midi est le moment id\xe9al pour une grande salade verte avec jus de citron, suivie de l\xe9gumes cuits si vous \xeates en phase de transition.","Arnold Ehret",B.ej,8)
B.aEX=new A.bT("\u267b\ufe0f","Autophagie activ\xe9e","Apr\xe8s 16h, l'autophagie cellulaire s'intensifie. Le corps recycle les prot\xe9ines endommag\xe9es et les cellules d\xe9fectueuses.","Dr. Morse",B.ek,10)
B.aEZ=new A.bT("\ud83c\udf2c\ufe0f","Moteur \xe0 air-gaz","Ehret enseignait que la respiration correcte nourrit chaque cellule. Commencez la journ\xe9e par 3 tours de WHM pour booster la vitalit\xe9.","Arnold Ehret",B.iA,6)
B.aF_=new A.bT("\ud83d\udd25","Transition c\xe9tose","Apr\xe8s 12h, le corps \xe9puise le glycog\xe8ne et commence \xe0 br\xfbler les graisses. C'est le d\xe9but du nettoyage m\xe9tabolique profond.","Arnold Ehret",B.ek,9)
B.aF6=new A.bT("\ud83c\udf4a","Premier repas id\xe9al","Ehret recommande de briser le je\xfbne nocturne avec un mono-fruit : oranges, raisins ou pamplemousse. Jamais de c\xe9r\xe9ales ou pain.","Arnold Ehret",B.ej,9)
B.aF7=new A.bT("\ud83d\udca7","Hydratation matinale","Un verre d'eau de source au r\xe9veil r\xe9hydrate les cellules apr\xe8s 8h de je\xfbne nocturne. Ajoutez du citron pour activer le drainage lymphatique.","Dr. Morse",B.xe,7)
B.aF8=new A.bT("\ud83c\udf19","Je\xfbne nocturne naturel","Chaque nuit est un mini-je\xfbne. Plus vous arr\xeatez de manger t\xf4t, plus le corps a de temps pour la d\xe9toxification nocturne.","Arnold Ehret",B.ek,6)
B.aF9=new A.bT("\u26a0\ufe0f","Diversit\xe9 excessive","Trop de vari\xe9t\xe9 dans un repas surcharge la digestion. Les 3 protocoles recommandent le mono-eating (un seul type d'aliment par repas).","Trophologie",B.xf,8)
B.ZY=new A.kg(3,"movement")
B.aFa=new A.bT("\ud83d\udeb6","Mouvement lymphatique","L'apr\xe8s-midi est id\xe9al pour une marche de 20-30 minutes. Le syst\xe8me lymphatique n'a pas de pompe \u2014 il d\xe9pend du mouvement physique.","Dr. Morse",B.ZY,6)
B.aFb=new A.bT("\u26a1","\xc9nergie du matin","Dr. Sebi recommande de commencer par de l'eau de source naturelle, puis un fruit du guide : mangue, papaye, ou baies avec p\xe9pins.","Dr. Sebi",B.ej,9)
B.aFe=new A.bT("\ud83c\udf2c\ufe0f","Oxyg\xe9nation cellulaire","Le fer transporte l'oxyg\xe8ne \u2014 la respiration profonde optimise l'absorption min\xe9rale. Essayez une session de respiration.","Dr. Sebi",B.iA,6)
B.aFh=new A.bT("\ud83e\uddec","Nettoyage profond","24h+ de je\xfbne : la r\xe9g\xe9n\xe9ration cellulaire s'acc\xe9l\xe8re. Buvez de l'eau de source. Reposez-vous si n\xe9cessaire \u2014 c'est normal.","Dr. Morse",B.ek,10)
B.aFi=new A.bT("\u2728","R\xe9g\xe9n\xe9ration avanc\xe9e","48h+ : le syst\xe8me immunitaire se r\xe9g\xe9n\xe8re. Les cellules souches sont stimul\xe9es. \xc9coutez votre corps attentivement.","Dr. Morse",B.ek,10)
B.aFj=new A.bT("\ud83c\udf3f","Repas \xe9lectrique","Composez votre assiette uniquement avec des aliments du guide Sebi. Quinoa + l\xe9gumes-feuilles + avocat = combinaison nourrissante.","Dr. Sebi",B.ej,8)
B.aFk=new A.bT("\ud83e\uded0","Collation vitaliste","Les baies sont l'aliment id\xe9al de mi-matin\xe9e : elles nourrissent le cerveau, nettoient la lymphe, et se dig\xe8rent en 30 minutes.","Dr. Morse",B.ej,6)
B.ZZ=new A.kg(8,"rest")
B.aFq=new A.bT("\ud83d\ude34","R\xe9g\xe9n\xe9ration nocturne","Entre 22h et 2h, le corps entre en mode r\xe9paration profonde. Le foie et le syst\xe8me lymphatique se nettoient pendant votre sommeil.","Dr. Morse",B.ZZ,7)
B.aFr=new A.bT("\ud83c\udf48","Repas astringent","Le syst\xe8me digestif est \xe0 son pic d'efficacit\xe9. Un repas de fruits astringents (raisins, agrumes) maximise le nettoyage lymphatique.","Dr. Morse",B.ej,8)
